import React from "react";
import "./contentTable.css";

const ContentTable = () => {
  return(
    <div clssName="content-box">
      <div class="list-header">
        <div class="row-header">Name</div>
        <div class="row-header">PhoneNumber</div>
        <div class="row-header">Birthday</div>
        <div class="row-header">Relation</div>
        <div class="row-header">Nationality</div>
        <div class="row-header">City</div>
        <div class="row-header">Menu</div>
      </div>
      <ol class="element-container">

      </ol>
    </div>
  );
}

export default ContentTable;
